script: |
  super -f text -I q8265.spq | sort > q8265.out

inputs:
  - name: q8265.spq
    data: |
      SELECT DISTINCT + + col0 / 75 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL IN ( 31 - + col1, - 53 / - col1 + 47 + + + 52 - + col1 / + col0 * 59 * + col0 * - CAST ( - col1 AS REAL ) );
  - name: tab2

outputs:
  - name: q8265.out
    data: |
